 [\n      21,\n      67,\n      96\n   ],\n   \"optional_ticker_speed\": \"normal\",\n   \"optional_ticker_motion\": \"right-left\",\n   \"ticker_type\": \"Scrolling Ticker\",\n   \"ticker_id\": 279\n}','admin','2022-07-20 10:15:49.348491','admin','2022-07-20 10:15:49.348510',0,1,NULL,'2022-07-20 10:45:00.000000','2022-07-20 10:17:00.000000','hello this in Ticker','[\'1st Floor\']','[\'1274\']','Medium','[\'Wing A\']','5 minutes','Sunday,Monday,Tuesday,Wednesday,Thursday,Friday,Saturday',6538,'[\'Standard\']'),(56,280,'Scrolling Ticker','{\n   \"static_ticker_condition\": false,\n   \"main_ticker_condition\": true,\n   \"moving_ticker_condition\": false,\n   \"optional_ticker_condition\": true,\n   \"emergency_ticker_condition\": false,\n   \"time_interval\": 60,\n   \"main_ticker_position\": \"up\",\n   \"main_ticker_message\": \"A tall player at 6 feet 1 inch (1.85 metres), Ronaldo was a formidable athlete on the pitch. Originally a right-winger, he developed into a forward with a free-reined attacking style. He was able to mesmerize opponents with a sleight of foot that made sufficient space for openings in opposing defenses.\\r\\n\\r\\nAfter a successful season with Sporting that brought the young player to the attention of Europe\\u2019s biggest football clubs, Ronaldo signed with English powerhouse Manchester United in 2003. He was an instant sensation and soon came to be regarded as one of the best forwards in the game. His finest season with United came in 2007\\u201308, when he scored 42 League and Cup goals and earned the Golden Shoe award as Europe\\u2019s leading scorer, with 31 League goals. After helping United to a Champions League title in May 2008, Ronaldo captured F\\u00e9d\\u00e9ration Internationale de Football Association (FIFA) World Player of the Year honours for his stellar 2007\\u201308 season. He also led United to an appearance in the 2009 Champions League final, which they lost to FC Barcelona.\",\n   \"main_ticker_logo\": false,\n   \"ma